import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';

export default class Home extends Component {

  MiniSudoku() {
      return (
        <div>Lucas</div>
      )
  }

  constructor(props) {
    super(props);

    this.state = {
      boardRows: [0, 1, 2, 3, 4, 5, 6, 7, 8]
    };
  }

  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col>
              <this.MiniSudoku />
            </Col>
          </Row>
        </Container>
      </div>
    )
  }
}
